In Rust you can write code that composes traits to implement functionality similar to subtyping in other languages. trait Animal { fn make_sound(&self);
} trait Fly { fn fly(&self);
} trait Swim { fn swim(&self);
} trait FlyingSwimmingAnimal: Animal + Fly + Swim { fn do_flying_swimming_stuff(&self) { self.make_sound(); self.fly(); self.swim(); }
} struct Duck { name: String,
} impl Animal for Duck { fn make_sound(&self) { println!("The duck {} says quack!", self.name); }
} impl Fly for Duck { fn fly(&self) { println!("The duck {} is flying.", self.name); }
} impl Swim for Duck { fn swim(&self) { println!("The duck {} is swimming.", self.name); }
} fn perform_actions<T: Animal + Fly + Swim>(animal: &T) { animal.make_sound(); animal.fly(); animal.swim();
} fn main() { let duck = Duck { name: String::from("Donald"), }; perform_actions(&duck);
} As part of the strictness of its programming model, Move does not support these constructs. Instead to achieve something similar to subtyping, it is often best to compose structs. That is, while you cannot establish an is relationship between types, you can establish a has relationship. This may be a more familiar model for those used to programming in C. module 0x42::Animal { use std::string; use std::debug; struct Animal { sound : string; name : string; } struct FlyingAnimal { flies : bool; speed : u8; animal : Animal; } struct Bird { flying_animal : FlyingAnimal; feather_description : string; } fun make_sound(animal : Animal){ debug::print(animal.sound); } fun bird_make_sound(bird : Bird){ make_sound(bird.flying_animal.animal); } } Importantly, however, you cannot compose types to provide bounds on generic functions. An equivalent of fn perform_actions<T: Animal + Fly + Swim>(animal: &T) does not exist. Further below, we will discuss more advanced means of achieving similar subtyping and polymorphism. However, in most cases, you will be better off simply choosing a simpler programming model.

