Storage polymorphism is the ability to index into global storage via a type parameter chosen at runtime. By leveraging storage polymorphism in combination with generics, Move developers can write generic algorithms, functions, and modules that can work with different resource types stored in the blockchain's storage. // source: https://move-language.github.io/move/global-storage-operators.html#global-storage-operators-with-generics struct Box<T> has key { t: T } // Publish a Container storing a type T of the caller's choosing
fun publish_generic_box<T>(account: &signer, t: T) { move_to<Box<T>>(account, Box { t })
} /// Publish a container storing a u64
fun publish_instantiated_generic_box(account: &signer, t: u64) { move_to<Box<u64>>(account, Box { t })
} While not as flexible as general polymorphism found in some languages, Move's storage polymorphism can quickly compose complex and useful operations for the blockchain. The below is an example of function for adding liquidity from Movement's dex router. Under the hood, global storage polymorphism is being used to enable to the publication of generic coins. /// Add liquidity to pool `X`/`Y` with rationality checks.
/// * `coin_x` - coin X to add as liquidity.
/// * `min_coin_x_val` - minimum amount of coin X to add as liquidity.
/// * `coin_y` - coin Y to add as liquidity.
/// * `min_coin_y_val` - minimum amount of coin Y to add as liquidity.
/// Returns remainders of coins X and Y, and LP coins: `(Coin<X>, Coin<Y>, Coin<LP<X, Y, Curve>>)`.
///
/// Note: X, Y generic coin parameters must be sorted.
public fun add_liquidity<X, Y, Curve>( coin_x: Coin<X>, min_coin_x_val: u64, coin_y: Coin<Y>, min_coin_y_val: u64,
): (Coin<X>, Coin<Y>, Coin<LP<X, Y, Curve>>) { assert!(coin_helper::is_sorted<X, Y>(), ERR_WRONG_COIN_ORDER); let coin_x_val = coin::value(&coin_x); let coin_y_val = coin::value(&coin_y); assert!(coin_x_val >= min_coin_x_val, ERR_INSUFFICIENT_X_AMOUNT); assert!(coin_y_val >= min_coin_y_val, ERR_INSUFFICIENT_Y_AMOUNT); let (optimal_x, optimal_y) = calc_optimal_coin_values<X, Y, Curve>( coin_x_val, coin_y_val, min_coin_x_val, min_coin_y_val ); let coin_x_opt = coin::extract(&mut coin_x, optimal_x); let coin_y_opt = coin::extract(&mut coin_y, optimal_y); let lp_coins = liquidity_pool::mint<X, Y, Curve>(coin_x_opt, coin_y_opt); (coin_x, coin_y, lp_coins)
}

