public entry fun set_up_test(origin_account: &signer, resource_account: &signer) { use std::vector; account::create_account_for_test(signer::address_of(origin_account)); // create a resource account from the origin account, mocking the module publishing process resource_account::create_resource_account(origin_account, vector::empty<u8>(), vector::empty<u8>()); init_module(resource_account);
